class SegmentOperations:
    def __init__(self, n, a):
        self.a = a
        self.p = 0
        self.max = n
        self.s = [0] * n
        self.s[0] = 1
        self.max_a = a
        self.s[-1] = -1
        self.max = max(self.max, n)

    def add(self, i, x):
        self.p += x
        self.s[i] = self.s[i] + x
        self.max = max(self.max, i)

    def __str__(self):
        return f'{self.p}'.format(self.max)

    def __floordiv(self, x):
        return self.p - x

    def __mul(self, x, y):
        return self.p * self.p - x * self.p

    def __floordivx(self, x, y):
        return self.p * self.p - y * self.p

    def __pow(self, x, y):
        return self.p - x * self.p - y * self.p

    def __lei(self, x):
        return self.p - x

    def __lti(self, x, y):
        return self.p - x * y

    def __lei2(self, x, y):
        return self.p - x * y

    def __gtx(self, x):
        return self.p - x

    def __eq(self, x, y):
        return self.p == x * y

    def __neig(self, x, y):
        return self.p == x * y

    def __res(self, a, b):
        return self.p - a * b

    def __getitem__(self, key):
        return self.p

    def __setitem__(self, key, value):
        if key not in self.s:
            self.s[key] = value
        elif self.s[key] < value:
            self.s[key] = value
        else:
            self.s[key] = value
        self.p = value
        return self.s[key]

    def __repr__(self):
        return "\n".join(str(self.p) for self in self.s)

