class Card:
    def __init__(self, n):
        self.n = n
        self.doubles = [0] * (n + 1)
        self.strengths = [0] * (n + 1)

    def add(self, value):
        self.doubles[value] += 1

    def dig(self, value):
        return self.doubles[value] - 1

    def flush(self):
        if self.doubles[-1] == 0:
            return
        elif self.doubles[-1] == 1:
            self.doubles[-1] = 0
        else:
            self.doubles[-1] = 1
