        return value == 0

    def is_strengths(self):
        return len(self.doubles)

    def dfs(self, value):
        if value not in self.strengths:
            self.strengths[value] = 0
        else:
            self.doubles[value] = 1
            self.helper(value)
            self.helper(value)
            self.dfs(value)
            self.doubles[value] = 0

