class Solution:
     def twoSum(self, nums, target):
         """
         :type nums: List[int]
         :type target: int
         :rtype: List[int]
         """
         if len(nums)<2:
             return nums
         else:
             return self.helper(nums,target)

     def helper(self,nums,target):
         """
         :type nums: List[int]
         :type target: int
         :rtype: List[int]
         """
         if len(nums)<self.count(target):
             return nums
         elif len(nums)==self.count(target):
             return self.helper(nums,target-nums.pop(0))
         else:
             return self.helper(nums,target-nums.pop(0))

